How to insert data with my node endpoint from an angular component?<p>I'm very new to angular and I'm trying to design a simple web. I have my backend ready in node.js. Right now I have an endpoint created where I insert data into my database. It's basically an endpoint to create posts.</p>

<p>This is my mongoose schema:</p>

<pre><code>const trackingPostSchema = new Schema({
    uuid: {
        type: String,
        unique: true,
      },
    post: [{
        foodUuid: String,
        pictureUrl: String,
        foodName: String,
        description: String,
        calories: Number,
        eatenAt: {
            type: Date,
            default: Date.now()
        },
        mealTime: String, //breakfast, lunch, dinner
    }],
  });
</code></pre>

<p>and I'm trying to insert the data with this component:</p>

<pre><code>&lt;nz-card style="width:300px;" nzTitle="Track what you ate today!"&gt;

  &lt;div class="content"&gt;

    &lt;input nz-input placeholder="Food Name" [(ngModel)]="foodName" style="max-width: 100px; min-width: 100px;" class="data"/&gt;

    &lt;input nz-input placeholder="Food Description" [(ngModel)]="description" style="max-width: 200px; min-width: 100px;" class="data"/&gt;

    &lt;label for="calories" style="margin-left: 10px"&gt;Calories: &lt;/label&gt;
    &lt;nz-input-number [(ngModel)]="calories" [nzMin]="1" [nzMax]="10000" [nzStep]="1" style="min-width: 100px;" class="data" id="calories"&gt;&lt;/nz-input-number&gt;

    &lt;nz-select
        style="width: 100px;"
        nzShowSearch
        nzAllowClear
        nzPlaceHolder="Select a meal time"
        [(ngModel)]="mealTime"
        class="data"
      &gt;
        &lt;nz-option nzLabel="Breakfast" nzValue="Breakfast"&gt;&lt;/nz-option&gt;
        &lt;nz-option nzLabel="Lunch" nzValue="Lunch"&gt;&lt;/nz-option&gt;
        &lt;nz-option nzLabel="Dinner" nzValue="Dinner"&gt;&lt;/nz-option&gt;
    &lt;/nz-select&gt;

    &lt;button nz-button nzType="primary" class="data"&gt;Post&lt;/button&gt;

  &lt;/div&gt;

&lt;/nz-card&gt;

</code></pre>

<p>I know it is a broad question, but what would be the steps I'd need to follow to send this data to my backend?</p>

