How do I get MongoDB to recognize a number as a double?<p>I am trying to save the number <code>3.0</code> into a schema that expects a double. Unfortunately it seems that Mongo interprets it as an integer and I get a validation failure error.</p>

<p>My validator looks like this:</p>

<pre><code>avgRating: {
  bsonType: 'double',
  minimum: 1,
  maximum: 5
},
</code></pre>

<p>My query looks like this:</p>

<pre><code>await db.collection('products').updateOne(
    {_id: productId},
    {
      $set: {
        avgRating: 3.0
      }
    },
);
</code></pre>

<p>I have checked with other numbers like <code>3.00001</code> or <code>4.2</code> and they work fine</p>

