MongoDB - Apply similar lookup on multiple columns in main table<p>I'm a newbie to MongoDB, I'm trying to aggregate complete details of students in referencing with other collections.</p>

<p><strong><code>students</code> collection structure:</strong></p>

<pre><code>{
    "_id" : ObjectId("5cc973dd008221192148177a"),
    "name" : "James Paulson",
    "teachers" : [ 
        ObjectId("5cc973dd008221192148176f"), 
        ObjectId("5cc973dd0082211921481770")
    ],
    "attenders": [ 
        ObjectId("5cc973dd0082211921481732"), 
        ObjectId("5cc973dd008221192148173f")
    ]
}
</code></pre>

<p><strong><code>staff</code> collection structure:</strong></p>

<pre><code>{
    "_id" : ObjectId("5cc973dd008221192148176f"),
    "name" : "John Paul",
    "subject" : [ 
        "english", 
        "maths"
    ]
}
{
    "_id" : ObjectId("5cc973dd0082211921481771"),
    "name" : "Pattrick",
    "subject" : [ 
        "physics", 
        "history"
    ]
}
{
    "_id" : ObjectId("5cc973dd0082211921481732"),
    "name" : "Roger",
    "subject" : [ 
        "sweeper"
    ]
}
{
    "_id" : ObjectId("5cc973dd008221192148173f"),
    "name" : "Ken",
    "subject" : [ 
        "dentist"
    ]
}
</code></pre>

<p>This is the query I used for the retrieval of all teacher details of a particular student.</p>

<p><strong>Query:</strong></p>

<pre><code>db.getCollection('students').aggregate([
  {
    $unwind: "$teachers"
  },      
  {
    $lookup:
    {
        from: 'staff',
        localField: 'teachers',
        foreignField: '_id',
        as: 'teachers'
    }
  }
]);
</code></pre>

<p><strong>Result:</strong></p>

<pre><code>{
    "_id" : ObjectId("5cc973dd008221192148177a"),
    "name" : "James Paulson",
    "teachers" : [ 
        {
            "_id" : ObjectId("5cc973dd008221192148176f"),
            "name" : "John Paul",
            "subject" : [ 
                "english", 
                "maths"
            ]
        }, 
        {
            "_id" : ObjectId("5cc973dd008221192148176f"),
            "name" : "Pattrick",
            "subject" : [ 
                "physics", 
                "history"
            ]
        }
    ],
    "attenders": [ 
        ObjectId("5cc973dd0082211921481732"), 
        ObjectId("5cc973dd008221192148173f")
    ]
}
</code></pre>

<p>As you can see, the <code>attenders</code> array is also similar to <code>teachers</code> except the difference in column name in students table. So how to applying a similar query to the second column (<code>attenders</code>)? Also is there any way to select specific columns from the second table (like only <code>_id</code> and <code>name</code> from <code>staff</code> collection)?</p>

<p>Any help on this would be greatly appreciated.</p>

