C# & MongoDb 2.0 - NearSphere issue<p>I am currently working on MongoDB with <strong>C#</strong> and I was wondering how was working near/geoNear in .NET. I could make it work in <strong>go</strong> but  I am struggling with <strong>C#</strong></p>

<p>In <strong>go</strong> I have the following:</p>

<pre><code>var addresses []*models.Address
bson.M{
    "location": bson.M{
        "$near": bson.M{
            "$geometry": bson.M{
                "type":        "Point",
                "coordinates": []float64{ in.Area.Longitude, in.Area.Latitude },
            },
            "$maxDistance": in.Area.Scope,
        },
    },
}, &amp;addresses)
</code></pre>

<p>Now in <strong>C#</strong>, I have the following:</p>

<pre><code>var options = new FindOptions&lt;SchoolDataModel&gt; { Limit = 10 }; // Just because I wanna limit to 10 results
var filter = NewFilterBuilder().NearSphere(s =&gt; s.Location, in.Area.Longitude, in.Area.Latitude);
return await (await GetCollection&lt;AddressDataModel&gt;().FindAsync(filter, options)).ToListAsync();
</code></pre>

<p>I am then getting the following:</p>

<blockquote>
  <p>"ExceptionMessage": "Command find failed: error processing query: ns=eyesapp.SchoolDataModel limit=9Tree: GEONEAR  field=Location maxdist=1.79769e+308 isNearSphere=1\nSort: {}\nProj: {}\n planner returned error: unable to find index for $geoNear query."</p>
</blockquote>

<p>I know in <strong>go</strong> I had to create an Index so I tried the same in <strong>C#</strong>:</p>

<pre><code>await GetMongoDatabase()
    .GetCollection&lt;AddressDataModel&gt;(typeof(AddressDataModel).Name)
    .Indexes.CreateOneAsync(new CreateIndexModel&lt;AddressDataModel&gt;(Builders&lt;AddressDataModel&gt;.IndexKeys.Geo2DSphere(x =&gt; x.Location)));
</code></pre>

<p>However I get the following exception when starting my ASP.NET app, when trying to create my index: </p>

<blockquote>
  <p>{"Command createIndexes failed: Can't extract geo keys: { _id: ObjectId.... }."}</p>
</blockquote>

<hr>

<p>By the end what I want to achieve is that, like in <strong>Go</strong>, be able to find addresses  near the given location, with a maximal distance, but also with a predefined limit, such as 10, 20 or 50.</p>

<p>Thanks for any help</p>

